import React from 'react';

import './Brunch.css';
import Page from './Page.js'
import Home from './Home.js'
import Sidebar from './Sidebar.js'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useParams,
  useRouteMatch
} from "react-router-dom";
import photos from './Data/Data.js'
import Display from './Display.js'



class Brunch extends Component() {
    render(){
  const photo = photos;


  return (

    <Router>

        <Switch>
          <Route exact path="/">
            <div className="Page-Header"><p>brunch</p></div>
            <div class="row">

                {photo.map((e,i) =>
                    <Display 
                    color={e.color}
                    photo={e.photo}
                    name={e.text}
                    key={i}
                    url={e.url}

                    />
                )}

            </div>
          </Route>
          {photo.map((route, index) => (
              // Render more <Route>s with the same paths as
              // above, but different components this time.
              <Route
                key={index}
                path={route.url}
                exact={route.exact}>
                  <Page 
                    color={route.color}
                    name={route.name}
                    relativeLocation={route.relativeLocation}
                    address={route.address}
                    commute={route.commute}
                    foodValue={route.foodValue}
                    blurb={route.blurb}
                    photos={route.photos}
                  />
              </Route>
            ))}

        </Switch>
        </Router>
  );
    }
}

export default Brunch;
